import React from 'react';
import {Button} from 'rebass'
import { NavLink } from 'react-router-dom'

const buttonStyle = {
  color: '#FFFFFF'
}

const HomeButton = () => {
  return (
  <Button>
    <NavLink style={buttonStyle} exact activeClassName="current" to={'./'}>
      Home
    </NavLink>
  </Button>
)
}

export default HomeButton;
